  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0103964 includes physical
  and underway data collected aboard the ENDEAVOR during cruise EN489 in the North
  Atlantic Ocean from 2011-03-22 to 2011-03-26. These data include CURRENT SPEED -
  EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments
  used to collect these data include ADCP and GPS. These data were collected by UNIVERSITY
  OF RHODE ISLAND; GRADUATE SCHOOL OF OCEANOGRAPHY as part of Simple Cabled Instrument
  for Measuring Parameters (SCIMPI). The Lamont-Doherty Earth Observatory (LDEO) submitted
  these data to NODC as part of the NSF sponsored Rolling Deck to Repository (R2R)
  program. The ADCP data represent the raw and automated processed data set. Post
  processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
